import React from "react";

const addasset = () => {
	return (
		<div>
			<button className="flex w-[112px] h-[41px] p-4 justify-center items-center gap-4 flex-shrink-0 rounded-lg bg-[#68C231] text-[#343B3F] font-roboto text-[10px] font-semibold">
				Add Asset
			</button>
		</div>
	);
};

export default addasset;
